//sendQuestionDataToGTM Fnc.
function sendQuestionDataToGTM(question, answer, cb) {
    
    if (parseInt(question) == 8) {
        window.history.pushState({}, "", '?sonuc');
    } else {
        window.history.pushState({}, "", '?soru=' + (parseInt(question) + 1));
    }
    checkAddBlocker(function (result) {
        if (result) {
            console.log('addblocker ak', 'question : ' + question, 'answer : ' + answer);
            cb && cb();
        } else {
            window.dataLayer.push({
                'event': 'UserAnswer',
                'question': question,
                'answer': answer,
                'eventCallback': function () {
                    console.log('addblocker kapal', 'question : ' + question, 'answer : ' + answer);
                    cb && cb();
                },
                'eventTimeout': 1500
            })
        }
    })
}






